CREATE TABLE tmp_report
   (REPORT_ID                     NUMBER(18) NOT NULL,
    REPORT_CODE                    VARCHAR2(50) NOT NULL,
    REPORT_NAME_CM_KEY            VARCHAR2(80) NOT NULL,
    REPORT_CATEGORY_TYPE        VARCHAR2(80) NOT NULL,
    REPORT_DESCRIPTION_CM_KEY    VARCHAR2(80),
    REPORT_URL                    VARCHAR2(255) NOT NULL,
    IS_ACTIVE                    NUMBER(1) NOT NULL,
    MODULE                        VARCHAR2(80),
    CM_ASSET_CODE                VARCHAR2(80),
    FORCE_PARAMETERS            NUMBER(1) NOT NULL,
    EXPORT_ONLY                    NUMBER(1) NOT NULL,
    CREATED_BY                   NUMBER(18),
    DATE_CREATED                 DATE,
    MODIFIED_BY                  NUMBER(18),
    DATE_MODIFIED                 DATE,
    VERSION                     NUMBER(18) NOT NULL    
   ) 
/

CREATE TABLE TMP_REPORT_CHART
(
  REPORT_CHART_ID         NUMBER(18)        NOT NULL,
  CAPTION_CM_KEY        VARCHAR2(80)    NOT NULL,
  SUBCAPTION_CM_KEY      VARCHAR2(80),
  CHART_DATA_URL           VARCHAR2(255)     NOT NULL,
  CHART_TYPE            VARCHAR2(30),
  REPORT_ID                NUMBER(18)        NOT NULL,
  SHOW_LABELS              NUMBER(1),
  SHOW_LEGEND              NUMBER(1),
  ENABLE_SMART_LABELS   NUMBER(1),
  SHOW_PERCENT_VALUES    NUMBER(1),
  X_AXIS_NAME_CM_KEY    VARCHAR2(80),
  Y_AXIS_NAME_CM_KEY    VARCHAR2(80),
  SEQUENCE_NUM          NUMBER(10),
  DISPLAY_LIMIT          NUMBER(10),
  CREATED_BY               NUMBER(18),
  DATE_CREATED             DATE,
  MODIFIED_BY              NUMBER(18),
  DATE_MODIFIED         DATE,
  VERSION                 NUMBER(18)        NOT NULL  
)
/
CREATE TABLE TMP_REPORT_PARAMETER
(
  REPORT_PARAMETER_ID  NUMBER(18)               NOT NULL,
  REPORT_ID            NUMBER(18)               NOT NULL,
  PARAMETER_NAME       VARCHAR2(80 BYTE)        NOT NULL,
  PARAMETER_CM_KEY     VARCHAR2(80 BYTE),
  DATABASE_COLUMN      VARCHAR2(80 BYTE)        NOT NULL,
  PARAMETER_TYPE       VARCHAR2(80 BYTE)        NOT NULL,
  LIST_DEFINITION      VARCHAR2(255 BYTE),
  PARAMETER_GROUP      VARCHAR2(80 BYTE),
  SEQUENCE_NUM         NUMBER(18),
  DISPLAY_ON_DASHBOARD NUMBER(1) DEFAULT 0      NOT NULL,
  CREATED_BY           NUMBER(18)               NOT NULL,
  DATE_CREATED         DATE                     NOT NULL,
  MODIFIED_BY          NUMBER(18),
  DATE_MODIFIED        DATE,
  VERSION              NUMBER(18)               NOT NULL,
  COLLECTION_NAME VARCHAR2(255 BYTE), 
        DEFAULT_VALUE VARCHAR2(255 BYTE),
        ADMIN_SELECT_ONLY NUMBER(1) DEFAULT 0 NOT NULL,
        HIDE_SHOW_ALL_OPTION NUMBER(1) DEFAULT 0 NOT NULL 
)
/
CREATE TABLE TMP_REPORT_DASHBOARD_ITEM
(
  REPORT_DASHBOARD_ITEM_ID  NUMBER(18)          NOT NULL,
