  VERSION                      NUMBER(18)       NOT NULL  
)
/

DECLARE

CURSOR C1 IS
SELECT trc.report_chart_id new_chart_id,
rc.report_chart_id old_chart_id,
rdi.*
FROM
report r,
tmp_report tr,
report_chart rc,
tmp_report_chart trc,
report_dashboard_item rdi
WHERE
r.report_code = tr.report_code
AND r.report_id = rc.report_id
AND tr.report_id = trc.report_id
AND rc.caption_cm_key = trc.caption_cm_key
AND rc.report_chart_id = rdi.report_chart_id;

CURSOR C2 IS
SELECT trp.report_parameter_id new_parameter_id,
rp.report_parameter_id old_parameter_id,rdip.*
FROM
report r,
tmp_report tr,
report_parameter rp,
tmp_report_parameter trp,
report_dashboard_item_param rdip
WHERE
r.report_code = tr.report_code
AND r.report_id = rp.report_id
AND rp.report_parameter_id = rdip.report_parameter_id
AND tr.report_id = trp.report_id
AND rp.parameter_name = trp.parameter_name;

